import React, { Component } from 'react'
import './record.css'
import {Card} from 'react-bootstrap'

const Record = () => {
    return(
        <div><div class="card bg-light">
        <div class="card-body text-center">
          <p class="card-text">Some text inside the fifth card</p>
        </div>
      </div></div>
    )
}

export default record
